import React, {Component} from 'react';
import '././css/App.css';
import Header from './Header';
import Footer from './Footer';

class App extends Component {
	constructor(){
		this.state = {
			countries: []
		}
	}

	listCountries(){
		this.setState({
			countries:[
				{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},
				{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},
				{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},
				{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},
				{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},{name: ''},
				{name: ''},{name: ''}

			]
		});
	}
  render(){
    return (
      <div >
        <Header/>



        <Footer/>
      </div>
    );
  }

}

export default App;
